Налаштування через веб-інтерфейс після введення IP-адреси

Бездротовий датчик відкриття Ajax DoorProtect Plus.

Основні характеристики:

- установка: внутрішня накладна;

- сенсори: геркон, акселерометр;

- поріг спрацьовування: 1 см (малий магніт), 2 см (великий магніт);

- роз'єм для підключення дротяних датчиків: є;

- захист від несанкціонованого розкриття корпусу: тампер;

- потужність радіосигналу: 20 мВт;

- протокол зв'язку з централлю: Jeweller (868,0 - 868,6 або 868,7 - 869,2 МГц залежно від регіону продажу);

- максимальна відстань між датчиком і централлю: 1000 м (на відкритому просторі);

- елемент живлення: батарея типу СR123А;

- напруга живлення: 3 В;

- захищає від вторгнення через двері і незакриті вікна;

- реагує на відкриття, зміна кута нахилу і удари;

- колір білий;

Виносний модуль індикації та управління. Суміщений з клавіатурою. Має світлодіодну індикацію 16 зон. Постановка під охорону кодами з клавіатури. Працює з Лунь-11, Лунь-23, Лунь-25. Дозволяє записувати радіодатчики в Лунь-11, Лунь-25.
Пристрій індикації і управління (УІУ) «Лінд-9м3» призначений для управління і індикації стану приладів приймально-контрольних (ППК) охоронно-пожежних «Лунь-11mod.2 / 3/4/5/6», «Лунь-21», «Лунь-23», «Лунь-25».

При використанні даного УІУ будуть доступні наступні основні функції: 
● постановка в охорону і зняття з охорони групи (в тому числі в режимі «Залишаюся дому»), а також відображення режиму охорони; 
● перегляд стану перших 16 зон обраної групи (включаючи порушення і несправність зон); 
● включення і виключення обходу зон 1 ... 16 обраної групи; 
● управління паролями / ключами (додавання, редагування, видалення); 
● відображення стану «Пожежа» і виконання скидання «Пожежі»; 
● відображення несправностей основного і резервного живлення; 
● відображення несправності зв'язку (як з приладом, так і з ПЦС) 
● відображення всіх несправностей системи після натискання однієї кнопки; 
● відображення рівня радіосигналу GSM;
● реєстрація до 16 радіодатчиків в групі і відображення їх рівня сигналу.

СПД-3,2__Сповіщувач диму 4-х провідний
Датчик диму СПД-3.2 використовується для виявлення ознак загоряння в приміщенні, що охороняється. Він виявляє дим за допомогою вбудованого фотоприймач і інфрачервоне випромінювання, які поміщені в спеціальну димову камеру приладу. Виявивши дим, прилад відправляє сигнал пожежної тривоги на пульт охорони. Спрацьовує звуковий сповіщувач.

особливості приладу
Стельовий простий монтаж. Щоб встановити датчик СПД-3.2 потрібно прочитати інструкцію і згідно з нею з'єднати клеми й проведення. Кріплення для приладу дозволяє швидко і надійно встановити його і також швидко зняти при необхідності.
Корпус з міцного пластику з ергономічним дизайном дозволяє зробити прилад непомітним навіть в самому сучасному дизайнерському інтер'єрі;
Відображення працездатності приладу за допомогою індикації;
Робота з будь-якими охоронними сигналізаціями;
Робоча площа пристрої до двадцяти квадратних метрів;
Харчування від центральної лінії енергопостачання, а також від блоків резервного живлення.
Це універсальний пристрій пожежної безпеки призначене для монтажу в житлових приміщеннях, ресторанах, готельних номерах, офісах, торгових павільйонах, магазинах, закладах культури, освіти, медицини.

Ціна на СПД-3.2 обумовлена його надійністю і технічними характеристиками.

Призначений для самостійної установки датчиків;
Допомагає встановити датчики під правильним кутом в потрібному напрямку без особливих зусиль (по горизонталі: ± 45 °, по вертикалі: 0 - 15 °);
Підходить до датчиків Optex;
Ідеально доповнює інтер'єр, датчик з кронштейном виглядає органічніше;
Виконаний з якісного ABS пластику.

Адаптер призначений для управління різними виконавчими пристроями (наприклад світло-звуковими оповещателями і т.п.). Адаптер дозволяє узгодити малопотужний пристрій управління (наприклад релейний вихід приладів приймально-контрольних, типу "відкритий колектор") з потужною навантаженням. Адаптер також забезпечує гальванічну розв'язку між пристроєм управління і навантаженням.

Основні параметри:

використовується реле з однією групою перемикаються контактів;
дозволяється комутація електричних навантажень постійного і змінного струму;
напруга спрацьовування реле - 12В;
струм спрацьовування реле, не більше - 40 мА;
максимальний комутований струм: при активному навантаженні (на постійній напрузі = 28В) - 12А; при активному навантаженні (на змінній напрузі = 250В) - 10А; при індуктивному навантаженні (на постійній напрузі = 28В) - 4 А; при індуктивному навантаженні (на змінній напрузі = 120В) - 4А;
опір електричного контакту, не більше - 0,1 Ом;
позначення контактів: SC - перемикаючий контакт; NC - нормально замкнутий контакт; NO - нормально розімкнутий контакт; + 12V - контакти обмотки реле.

Двопроменевий інфрачервоний TRX-60M
Сповіщувачі серії TRX - це активні інфрачервоні двох променеві бар'єри. Такий сповіщувач складається з приймача і передавача. Захищене виконання елементів, що знаходяться в корпусі з термостійкого пластику, дозволяє використовувати сповіщувач в екстремальних кліматичних умовах при зовнішній установці. Сповіщувач реєструє вторгнення тільки при одночасному перетині верхнього та нижнього променів, що захищає систему від помилкових тривог викликаних, наприклад, рухом дрібних домашніх тварин або падає листя. Бар'єр рекомендується використовувати для захисту дверей, вікон, воріт, складів з високими стелажами і для захисту периметрів. Відстань між приймачем і передавачем для сповіщувачів TRX в залежності від їх типу становить: TRX-40M (5 - 40 м), TRX-60M (30- 60 м), TRX-80M (60 80м), TRX-100M (80 100м) , TRX-150M (100-150м).
зручну регулювання їх оптичної осі; 
регулювання часу переривання променя; 
стабільність роботи в несприятливих умовах навколишнього середовища.

сумісність з приладами INTEGRA і INTEGRA Plus (версії 1.18 або вище);
дві SIM-карти;
можливість перевірки балансу на рахунку карт;
синхронізація часу (NTP або GSM);
повідомлення: SMS, PUSH, e-mail (INTEGRA Plus);
віддалене оновлення: SMS, CLIP, мобільний додаток;
моніторинг: GPRS (TCP / UDP), SMS;
можливість інтеграції з модулем ETHM-1 Plus (версії 2.05 або вище):
Dual Path Reporting (сумісність з EN 50136);
резервний канал зв'язку;
можливість використовувати послугу SATEL по установці з'єднань;
підтримка мобільного додатка INTEGRA CONTROL;
Android (версії 4.2.7 або вище);
iOS (версії 5.0 або вище);
підтримка ПЗ DLOADX (версії 1.18.000 або вище);
підтримка ПОGUARDX;
можливість підключення до системи INTEGRUM;
підтримка UpServ (віддалене оновлення прошивки модуля);

Satel CA-6 KLED - клавіатура світлодіодна для ПКП СА-6;
Світлодіодні індикатори, що відображають стан зон, груп і системи;
Тривоги, що викликаються з клавіатури: НАПАД, ПОЖЕЖА, ДОПОМОГА;
Підсвічування клавіш;
Для передачі інформації про стан охоронної системи використовуються акустичні сигнали і 15 світлодіодних індикаторів;
Оснащена 12 клавішами. З їх допомогою можна вводити дані і запускати вибрані функції;
Для зручності користувача клавіші мають підсвічування, а їх натискання підтверджує звуковий сигнал;
З даної клавіатури можна також подати найбільш важливі сигнали тривоги: ДОПОМОГА, НАПАД, ПОЖЕЖА.
CA-6 KLED від виробника Satel - клавіатура, основне призначення якої управління і програмування ПКП CA-6.

Slinex ML-20IP - виклична панель працює через WIFI, що дозволяє переадресувати відео і аудіо виклик на мобільні пристрої IOS / Android і надає віддалений перегляд з ПК. Має вбудовану відеокамеру 1,3 МП, ІЧ підсвічування до 1.5м, вбудоване реле для управління замком, а також вбудовану пам'ять 8Гб для можливості відео фіксації відвідувачів натиснули на кнопку виклику а також по руху.

&nbsp;

























&nbsp;

На даний момент це єдина виклична панель на ринку з постійним та зображенням. Завдяки цьому, панель виклику Slinex ML-15 можна підключити до реєстратора або до відеодомофону з функцією реєстратора. Запис може проводитися постійно або по детекції руху, при цьому зображення для запису буде виводитися незалежно від того, чи був здійснений виклик з панелі. Другою відмітною особливість Slinex ML-15HR є той факт, що в ній стоїть камера підвищеного дозволу (600 ТВЛ), завдяки чому відео з цієї панелі буде чудово виглядати на відеодомофон з діагоналлю екрану від 7 дюймів.

&nbsp;

























&nbsp;

Кольорова антивандальна виклична відеопанель з камерою 800 ТВЛ і світлодіодним підсвічуванням. Корпус виконаний з якісно обробленої нержавіючої сталі. Виразний монтаж.

&nbsp;

























&nbsp;

Це одноабонентська кольорова антивандальна відео панель типу «Вежа». Дана модель комплектується, крім інструкції ну російською мовою, козирком і поворотним кронштейном на 30 градусів. Колірна гама Slinex ML-15 відрізняється різноманітністю - є чорний колір, сірий і золотий. Тому без проблем можна вибрати колір, який підходить під колір ваших дверей.

Висота даної панелі становить 134 мм, ширина - 50, а глибина - 30 мм. На лицьовій частині є одна велика кнопка для виклику. Особливості цієї кнопки полягає в тому, що вона підсвічується. Завдяки цьому у ваших відвідувачів не буде проблем з тим, щоб знайти кнопку виклику, якщо вони прийдуть до вас у нічний час.

Slinex ML-15 добре поєднується з домофонами таких марок як Slinex, Commax, Kocom і Kenwei.

&nbsp;

























&nbsp;

Джерело безперебійного живлення Eaton 5E 650VA, USB DIN (5E650IUSBDIN) - сучасний лінійно-інтерактивне джерело, представлений покупцям на початку 2014р. Джерело орієнтований на захист ПК, робочих станцій, мережевих накопичувачів, торгових автоматів і АТС. Невеликі габарити джерела дозволяють розмістити його навіть в самих обмежених умовах.

Головні особливості ІБП Eaton 5E 650iUSBDIN:
Робота при зниженому або підвищеному напрузі без розряду батарей завдяки технології автоматичного регулювання напруги (AVR);
Компактні розміри моделі дозволяють встановлювати ДБЖ там, де це необхідно;
Батареї 5Е заряджаються безперервно (навіть коли ІБП вимкнений), можливий «холодний» пуск ДБЖ без підключення до мережі

Врізний сувальдний замок для вхідних металевих дверей 57685 CISA (Чизай).

   • Даний замок оснащений сучасною системою захисту від розтину відмичкою ALPS
   Продовжуючи вдосконалювати передові перекодіруемие замки New Cambio Facile, в 2011 р інженери компанії CISA створили і запатентували систему захисту блоку сувальд "ALPS" (All Levers Protection System). 
Система "ALPS" анналогічна вже відомій системі "Antipicking" різниця лише в тому що "ALPS" реалізується на замках з системою New CAMBIO FACILE .

   Замок оснащений системою New CAMBIO FACILE . Ця система дозволяє в разі потреби поміняти комплект ключів, не розбираючи і не міняючи ваш замок. При покупці замку покупець отримує в запечатаному конверті основний комплект ключів, код яких відмінний від коду монтажного ключа (монтажний ключ виключно для установки двері так як він має одну стандартну нарізку і підходить до будь-якого замку цієї ж моделі в монтажній кодуванні), а також спеціальний інструмент для перекодування - Г-подібний ключ. При виникненні тривожної ситуації або в силу інших причин господар може скасувати дію старих ключів, замінивши їх ключами з нового перекодіровочного комплекту. На зміну коду замку у вас піде не більше хвилини! 
   • Даний замок оснащений системою NewCAMBIO FACILE . 
   Ця система дозволяє в разі потреби поміняти комплект ключів, не розбираючи і не міняючи ваш замок.

   При виникненні тривожної ситуації або в силу інших причин господар може скасувати дію старих ключів, замінивши їх ключами з нового перекодіровочного комплекту. На зміну коду замку у вас піде не більше хвилини!

   Слід особливо відзначити, що дана операція по перекодуванні може проводитися необмежену кількість разів, що гарантує вам максимальний спокій, а головне - безпека. Все геніальне просто: ключ міняється, а замок залишається!

Чотири ригеля діаметром 18 мм. з ходом 37 мм. ;
Засувка приводиться в дію ключем і фалевой ручкою;
Повне замикання в 4 обороту;
BackSet (В) - 64 мм. ;
Між центровий відстань 85 мм. ;
   Комплектація:

Замок 1 штука;
ключів в герметичній упаковці 5 штук;
монтажний ключ 1 штука;
г подібний ключ для перекодування 1 штука;
щитки в кольорі золото на сувальдний частина 2 штуки;
кодова картка 1 штука;
інструкція 1 штука;
Зверніть увагу! Врізні замки Cisa поставляються в Україну в технічній упаковці.

CISA 1.1610.50.2 Накладний електромеханічний замок
призначений для здійснення контролю доступу на об'єкті. Виконаний з міцного металу пофарбованого в сірий колір. Відрізняється від аналогів підвищеною міцністю і зносостійкістю.

Замок підходить для установки на другий тип дверей (ручка справа, петлі зліва, двері відкриваються всередину).

Управління замком здійснюється 3 способами:

Електричний - подання електронної імпульсу, який відмикає ригель;
Механічний - натисканням на кнопку виходу, розміщеної на корпусі замку.
Стандартний - відкривання замка звичайним ключем.
Cisa 11630.50.2 легко інтегрується в різні системи контролю доступу ( домофони , контролери , системи охоронної та пожежної сигналізації)

Будьте уважні! Замок не має блокування кнопки виходу і режиму провітрювання.

Комплектація:

Електромеханічний замок CISA 1.11610.50.2 - 1шт;
Відповідна частина - 1шт;
Циліндр - 1шт;
Захисна пластина з козирком і підкладка під відповідну коробку - 1шт;
Ключ - 3шт;
Гвинти - 1 комплект;
Інструкція - 1шт Подробнее: https://etechnika.prom.ua/p118222811-cisa-111610502-zamok.html

Використовується для управління електронними замками ;
Спосіб установки: виразний ;
Спосіб натискання: контактний ;
Підсвічування: відсутня ;
Працює при температурі: від -30 ° С до + 50 ° С ;
Висока міцність завдяки металевому корпусу ;
Підходить для приміщень з високою відвідуваністю ;
Встановлюється в приміщенні або на вулиці (уникати потрапляння вологи на контакти).
Кнопка виходу моделі ART-800B використовується в системах контролю і управління доступом ( СКУД ). Вона призначена для розблокування електронних замків. Має коммутируемую навантаження 3А . Контакти відносяться до типів нормально розімкнутих (нормально відкритих) і нормально замкнутих (або нормально закритих). Робота даного пристрою не залежить від зчитувачів. Найчастіше, панель з кнопкою розміщують всередині приміщення, в безпосередній близькості до дверей. Вона служить тільки для виходу .

Пристрій являє собою металеву кнопку невеликих розмірів ( 86х86х20 ), розташовану на міцній алюмінієвій панелі квадратної форми, яка кріпиться способом врізного монтажу. Кнопка виходу ART-800B досить міцна, завдяки металевому корпусу та практичному механізму натискання. Вона розрахована на високу інтенсивність використання, тому прекрасно підійде для приміщень з високою відвідуваністю.

Принцип дії пристрою простий. При натисканні кнопки в СКУД подається відповідний сигнал. Отримавши його, система контролю і управління доступом на деякий час розблокує електронний механізм, що дозволяє людині безперешкодно покинути приміщення. При натисканні кнопки виходу ідентифікація не здійснюється. Пристрій тільки фіксує факт виходу.

Кнопка виходу - вогнетривка, а міцна панель надійно захищає її від механічних пошкоджень. Пристрій може нормально функціонувати в температурному діапазоні від -30 ° С до + 50 ° С , що робить можливою його установку в неопалюваних приміщеннях і навіть зовні. Правда, в останньому випадку потрібно уникати прямого попадання вологи на контакти.

У комплект входить одна кнопка виходу ART-800B і металева панель.

